<style>
  

    /* ZMIENNE UI */
    :root {
      --primary-color: #006838;
      --bg-color: #ffffff;
      --panel-bg: #ffffff;
    }

    /* UKŁAD STRONY */
    body { font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; background-color: var(--bg-color); margin: 0; padding: 0; width: 100%; display: flex; justify-content: center; align-items: center; overflow: hidden; }
    .main-layout { display: flex; flex-direction: row; background: var(--panel-bg); border-radius: 20px; box-shadow: 0 15px 40px rgba(224, 224, 224, 1); width: 95%; height: 90vh; max-width: 1600px; overflow: hidden; }
    .bouquet-display { flex-grow: 1; background-color: var(--panel-bg); display: flex; justify-content: center; align-items: center; padding: 20px; position: relative; overflow: hidden; }
    
    /* Ustawienia SVG */
    svg { width: 100%; height: 100%; max-height: 85vh; display: block; }

    /* KLASY WIDOCZNOŚCI */
    .hidden-flower { display: none !important; }
    .show-flower { display: block !important; }

    /* GIPSÓWKA ZAWSZE WIDOCZNA */
    [id*="gips"], [id*="Gips"] { display: block !important; }

    /* PANEL STEROWANIA */
    .controls { width: 350px; min-width: 300px; background: #ffffff; border-left: 1px solid #f0f0f0; display: flex; flex-direction: column; overflow-y: auto; padding: 30px; box-sizing: border-box; }
    h1 { color: var(--primary-color); margin-top: 0; font-size: 24px; text-align: center; margin-bottom: 20px; }
    h3 { margin: 20px 0 10px 0; font-size: 14px; color: #888; text-transform: uppercase; letter-spacing: 1px; border-bottom: 2px solid #DFF7EB; padding-bottom: 5px; }
    .section { margin-bottom: 10px; }
    .slots-grid { display: grid; grid-template-columns: 1fr 1fr; gap: 12px; }
    .control-group label { display: block; font-size: 11px; font-weight: bold; color: #555; margin-bottom: 4px; }
    select, textarea { width: 100%; padding: 8px; border: 1px solid #ddd; border-radius: 6px; font-size: 14px; background-color: #fff; cursor: pointer; box-sizing: border-box; font-family: inherit; }
    select:hover, textarea:focus { border-color: var(--primary-color); outline: none; }
    textarea { resize: vertical; margin-top: 5px; }
    .color-palette { display: flex; flex-wrap: wrap; gap: 8px; margin-top: 5px; min-height: 35px; }
    .swatch { width: 28px; height: 28px; border-radius: 50%; border: 2px solid #e0e0e0; cursor: pointer; transition: transform 0.2s; }
    .swatch:hover { transform: scale(1.1); }
    .swatch.active { border: 3px solid #333; transform: scale(1.15); box-shadow: 0 2px 5px rgba(0,0,0,0.2); }
    .swatch[style*="rgb(255, 255, 255)"], .swatch[style*="#ffffff"] { border: 1px solid #ccc; }
    .checkbox-container { display: flex; align-items: center; margin-top: 12px; font-size: 15px; color: #333; cursor: pointer; user-select: none; font-weight: 700; padding: 5px 0; }
    .checkbox-container input { margin-right: 10px; width: 20px; height: 20px; accent-color: var(--primary-color); cursor: pointer; }
    .summary-box { margin-top: 20px; padding-top: 20px; border-top: 2px dashed #fce4ec; text-align: center; }
    .price-display { font-size: 28px; color: var(--primary-color); font-weight: 800; margin-bottom: 10px; letter-spacing: 0.5px; }
    button { cursor: pointer; border: none; border-radius: 8px; font-weight: 600; font-family: inherit; transition: all 0.2s; }
    .btn-random { margin-top: 15px; width: 100%; padding: 10px; background-color: #f0f0f0; color: #333; border: 1px solid #ddd; }
    .btn-random:hover { background-color: #e0e0e0; }
    .btn-finish { width: 100%; padding: 18px; background-color: var(--primary-color); color: white; font-size: 18px; margin-top: 10px; box-shadow: 0 4px 10px rgba(224, 224, 224, 1); }
    .btn-finish:hover { background-color: #DFF7EB ; color: #006838; transform: translateY(-2px); }
    @media (max-width: 900px) { .main-layout { flex-direction: column; height: auto; width: 90%; margin: 20px 0; border-radius: 0; } body { height: auto; overflow-y: auto; } .bouquet-display { min-height: 400px; } .controls { width: 100%; border-left: none; border-top: 1px solid #f0f0f0; height: auto; overflow: visible; } }
  </style>

    <div class="controls">
      <h1>Kreator Bukietu</h1>
      
      <div class="section">
        <h3>1. Wielkość bukietu</h3>
        <label>Ile kwiatów?</label>
        <select id="flower-count" onchange="updateCount()">
          <option value="9" selected>9 Kwiatów (Pełny)</option>
        </select>
      </div>

      <div class="section">
        <h3>2. Kolorystyka</h3>
        
        <label>Kolor kwiatów:</label>
        <div class="color-palette" id="flower-palette"></div>
        
        <label class="checkbox-container">
          <input type="checkbox" id="mix-mode-check" onchange="applyAllColors()">
          <span class="checkmark"></span>
          Dual Kolor (Białe dodatki)
        </label>

        <label style="margin-top: 15px;">Kolor doniczki:</label>
        <div class="color-palette" id="pot-palette"></div>

        <label style="margin-top: 10px;">Kolor kokardy:</label>
        <div class="color-palette" id="bow-palette"></div>
      </div>

      <div class="section">
        <h3>3. Kompozycja</h3>
        <div id="slots-container" class="slots-grid"></div>
        <button class="btn-random" onclick="randomize()">🎲 Losuj układ</button>
      </div>

      <div class="section">
        <h3>4. Wykończenie</h3>
        <label>Wybierz zapach:</label>
        <select id="scent-select">
          <option value="Róża">🌹 Róża</option>
          <option value="Piwonia">🌸 Piwonia</option>
          <option value="Pomarańcza">🍊 Pomarańcza</option>
          <option value="Lawenda">🌿 Lawenda</option>
          <option value="Aloes">🌵 Aloes</option>
        </select>
      </div>

      <div class="section">
        <h3>5. Dodatki</h3>
        <label>Komentarz do zamówienia:</label>
        <textarea id="order-comment" rows="3" placeholder="Wpisz treść bileciku..."></textarea>
      </div>
      
      <div class="summary-box">
        <div class="price-display">Cena: 159,99 zł</div> 
        <button class="btn-finish" onclick="finishOrder()">Zamów Bukiet</button>
      </div>
    </div>
  </div>

  <script>
  

    const maxSlots = 9;

    // --- KOLORY ---
    const flowerColors = [
      '#4169E1', // Niebieski
      '#40E0D0', // Turkusowy
      '#FF69B4', // Różowy
      '#F5F5DC', // Beżowy
      '#FFFFFF', // Biały
      '#8B0000', // Ciemna Czerwień
      '#1a1a1a'  // Czarny
    ];

    const potColors = [
      { color: '#ffffff', name: 'Biała' },
      { color: '#2C2C2C', name: 'Czarna (Grafit)' },
      { color: '#D4AF37', name: 'Złota' }
    ];

    const bowColors = [
      { color: '#D4AF37', name: 'Złota' },
      { color: '#FF69B4', name: 'Różowa' },
      { color: '#8B0000', name: 'Czerwona' },
      { color: '#ffffff', name: 'Biała' },
      { color: '#1a1a1a', name: 'Czarna' }
    ];

    const flowerTypes = [
      { value: 'pusty', label: '---' },
      { value: 'roza', label: 'Róża' },
      { value: 'piwonia', label: 'Piwonia' },
      { value: 'tulipan', label: 'Tulipan' }
    ];

    // Stan aplikacji
    let currentFlowerColor = flowerColors[2];
    let currentPotColorHex = potColors[0].color;
    let currentPotColorName = potColors[0].name;
    let currentBowColorHex = bowColors[0].color;
    let currentBowColorName = bowColors[0].name;

    function init() {
      generateSlotControls();
      generateAllPalettes();
      prepareSvgVisibility(); 
      randomize();
      updateCount();
      
      // Opóźnienie startowe dla pewności
      setTimeout(applyAllColors, 100);
    }

    // === GŁÓWNE FUNKCJE KOLORUJĄCE ===

    function applyAllColors() {
      // 1. Doniczka
      applyColorSafely('oniczka', currentPotColorHex);
      
      // 2. Kokarda
      applyColorSafely('okarda', currentBowColorHex);
      
      // 3. Kwiaty
      applyFlowerColors();
    }

    function applyFlowerColors() {
        const mixCheckbox = document.getElementById('mix-mode-check');
        const isMixMode = mixCheckbox ? mixCheckbox.checked : false;
        const whiteSlots = [2, 3, 7, 9]; 
        
        for (let i = 1; i <= maxSlots; i++) {
            // Ustal kolor dla danego slotu
            let colorToUse = currentFlowerColor;
            if (isMixMode && whiteSlots.includes(i)) {
                colorToUse = '#ffffff';
            }

            // Znajdź grupę slotu (Slot_1 lub slot_1)
            let variations = [`Slot_${i}`, `slot_${i}`];
            for(let id of variations) {
                let slotGroup = document.getElementById(id);
                if(slotGroup) {
                    const allGroups = slotGroup.querySelectorAll('g');
                    
                    allGroups.forEach(g => {
                        const gid = g.id.toLowerCase();
                        if (gid.includes('roza') || gid.includes('piwonia') || gid.includes('tulipan')) {
                            const shapes = g.querySelectorAll('path, rect, polygon, circle, ellipse');
                            
                            shapes.forEach(shape => {
                                 const shapeId = shape.id ? shape.id.toLowerCase() : '';
                                 const parentId = shape.parentElement.id ? shape.parentElement.id.toLowerCase() : '';

                                 // OMIJAMY TYLKO OBRYSY
                                 if (shapeId.includes('obrys') || parentId.includes('obrys')) return;
                                 
                                 shape.style.fill = colorToUse;
                                 shape.setAttribute('fill', colorToUse);
                            });
                        }
                    });
                }
            }
        }
    }

    function applyColorSafely(keyword, color) {
      const allElements = document.querySelectorAll('svg [id]');
      allElements.forEach(el => {
        const id = el.id.toLowerCase();
        if (id.includes(keyword.toLowerCase()) && id.includes('kolor')) {
            let shapes = [];
            if (el.tagName === 'g') {
                shapes = el.querySelectorAll('path, rect, polygon, circle, ellipse');
            } else {
                shapes = [el];
            }
            shapes.forEach(shape => {
                const shapeId = shape.id ? shape.id.toLowerCase() : '';
                const parentId = shape.parentElement.id ? shape.parentElement.id.toLowerCase() : '';
                if (shapeId.includes('obrys') || parentId.includes('obrys')) return;
                
                shape.style.fill = color;
                shape.setAttribute('fill', color);
            });
        }
      });
    }

    // === RESZTA FUNKCJI LOGICZNYCH ===

    function prepareSvgVisibility() {
        for (let i = 1; i <= maxSlots; i++) {
            let variations = [`slot_${i}`, `Slot_${i}`];
            for (let id of variations) {
                let slotGroup = document.getElementById(id);
                if (slotGroup) {
                    let children = slotGroup.querySelectorAll('g');
                    children.forEach(child => {
                       if (!child.id.toLowerCase().includes('gips')) {
                           child.classList.add('hidden-flower');
                           child.style.display = 'none';
                       }
                    });
                }
            }
        }
    }

    function generateAllPalettes() {
      const flowerContainer = document.getElementById('flower-palette');
      if(flowerContainer) {
          flowerContainer.innerHTML = '';
          flowerColors.forEach(color => {
            const btn = createSwatch(color);
            btn.onclick = () => {
              currentFlowerColor = color;
              highlightSwatch('flower-palette', color);
              applyAllColors();
            };
            flowerContainer.appendChild(btn);
          });
      }

      const potContainer = document.getElementById('pot-palette');
      if(potContainer) {
          potContainer.innerHTML = '';
          potColors.forEach(item => {
            const btn = createSwatch(item.color);
            btn.onclick = () => {
              currentPotColorHex = item.color;
              currentPotColorName = item.name;
              highlightSwatch('pot-palette', item.color);
              applyAllColors();
            };
            potContainer.appendChild(btn);
          });
      }

      const bowContainer = document.getElementById('bow-palette');
      if(bowContainer) {
          bowContainer.innerHTML = '';
          bowColors.forEach(item => {
            const btn = createSwatch(item.color);
            btn.onclick = () => {
              currentBowColorHex = item.color;
              currentBowColorName = item.name;
              highlightSwatch('bow-palette', item.color);
              applyAllColors();
            };
            bowContainer.appendChild(btn);
          });
      }
    }

    function createSwatch(color) {
      const btn = document.createElement('div');
      btn.className = 'swatch';
      btn.style.backgroundColor = color;
      return btn;
    }

    function highlightSwatch(containerId, color) {
      const container = document.getElementById(containerId);
      if(!container) return;
      const swatches = container.getElementsByClassName('swatch');
      const temp = document.createElement('div');
      temp.style.color = color;
      document.body.appendChild(temp);
      const computedColor = window.getComputedStyle(temp).color;
      document.body.removeChild(temp);
      for (let s of swatches) {
        s.classList.remove('active');
        if (s.style.backgroundColor === color || s.style.backgroundColor === computedColor) {
           s.classList.add('active');
        }
      }
    }

    function generateSlotControls() {
      const container = document.getElementById('slots-container');
      if(!container) return;
      container.innerHTML = '';
      for (let i = 1; i <= maxSlots; i++) {
        const div = document.createElement('div');
        div.className = 'control-group';
        div.id = `control-group-${i}`;
        const label = document.createElement('label');
        label.innerText = `Kwiat ${i}`;
        const select = document.createElement('select');
        select.id = `select-slot-${i}`;
        select.onchange = () => {
            updateFlowerVisuals(i, select.value);
            applyAllColors();
        };
        flowerTypes.forEach(flower => {
          const option = document.createElement('option');
          option.value = flower.value;
          option.innerText = flower.label;
          select.appendChild(option);
        });
        div.appendChild(label);
        div.appendChild(select);
        container.appendChild(div);
      }
    }

    function updateCount() {
      const countEl = document.getElementById('flower-count');
      if(!countEl) return;
      const count = parseInt(countEl.value);
      for (let i = 1; i <= maxSlots; i++) {
        const controlDiv = document.getElementById(`control-group-${i}`);
        if (i <= count) {
          if(controlDiv) controlDiv.style.display = 'block';
          const currentSelect = document.getElementById(`select-slot-${i}`);
          updateFlowerVisuals(i, currentSelect.value);
        } else {
          if(controlDiv) controlDiv.style.display = 'none';
          hideAllFlowersInSlot(i);
        }
      }
      setTimeout(applyAllColors, 50);
    }

    function updateFlowerVisuals(slotNum, type) {
      hideAllFlowersInSlot(slotNum);
      if (type !== 'pusty') {
        let variations = [`Slot_${slotNum}_${type}`, `slot_${slotNum}_${type}`, `${type}_${slotNum}`];
        let foundEl = null;
        for (let id of variations) {
            let el = document.getElementById(id);
            if (el) { foundEl = el; break; }
        }
        if (!foundEl) {
            let slotGroup = document.getElementById(`slot_${slotNum}`) || document.getElementById(`Slot_${slotNum}`);
            if (slotGroup) {
                let children = slotGroup.querySelectorAll('g');
                children.forEach(child => {
                    if (child.id.toLowerCase().includes(type) && !child.id.toLowerCase().includes('gips')) {
                        foundEl = child;
                    }
                });
            }
        }
        if (foundEl) {
            foundEl.classList.remove('hidden-flower');
            foundEl.style.display = 'block';
        }
      }
    }

    function hideAllFlowersInSlot(slotNum) {
      let slotGroup = document.getElementById(`slot_${slotNum}`) || document.getElementById(`Slot_${slotNum}`);
      if (slotGroup) {
          let children = slotGroup.children; 
          for (let i = 0; i < children.length; i++) {
              let child = children[i];
              if (!child.id.toLowerCase().includes('gips')) {
                 child.classList.add('hidden-flower');
                 child.style.display = 'none';
              }
          }
      }
    }

    function randomize() {
      const countEl = document.getElementById('flower-count');
      if(!countEl) return;
      const count = parseInt(countEl.value);
      const types = ['roza', 'piwonia', 'tulipan'];
      for (let i = 1; i <= maxSlots; i++) {
        const select = document.getElementById(`select-slot-${i}`);
        if (i <= count) {
          const randomType = types[Math.floor(Math.random() * types.length)];
          select.value = randomType;
          updateFlowerVisuals(i, randomType);
        } else {
          select.value = 'pusty';
          updateFlowerVisuals(i, 'pusty');
        }
      }
      setTimeout(applyAllColors, 50);
    }

    function finishOrder() {
      const count = parseInt(document.getElementById('flower-count').value);
      const scent = document.getElementById('scent-select').value;
      const comment = document.getElementById('order-comment').value;
      const isMix = document.getElementById('mix-mode-check').checked;
      
      let selectedFlowersList = [];
      for (let i = 1; i <= count; i++) {
        const select = document.getElementById(`select-slot-${i}`);
        const flowerName = select.options[select.selectedIndex].text;
        selectedFlowersList.push(`Miejsce ${i}: ${flowerName}`);
      }

      let colorInfo = currentFlowerColor;
      if(isMix) {
          colorInfo += " + Biały (Dual Kolor)";
  }

  const orderData = {
    iloscKwiatow: count,
    kolorKwiatow: colorInfo,
    kolorDoniczki: currentPotColorName + ` (${currentPotColorHex})`,
    kolorKokardy: currentBowColorName + ` (${currentBowColorHex})`,
    skladBukietu: selectedFlowersList,
    zapach: scent,
    uwagi: comment || "Brak",
    cena: "299.99 zł"
  };

  console.log("=== ZAMÓWIENIE ===", orderData);
  let msg = `DZIĘKUJEMY ZA ZAMÓWIENIE!\n\n`;
  msg += `Cena: ${orderData.cena}\n`;
  msg += `Ilość: ${orderData.iloscKwiatow} szt.\n`;
  msg += `Kolory:\n  Kwiaty: ${orderData.kolorKwiatow}\n  Doniczka: ${orderData.kolorDoniczki}\n  Kokarda: ${orderData.kolorKokardy}\n`;
  msg += `Zapach: ${orderData.zapach}\n`;
  msg += `Uwagi: ${orderData.uwagi}\n\n`;
  msg += `Szczegóły składu:\n${orderData.skladBukietu.join('\n')}`;
  alert(msg);
}

// Uruchomienie
init();
  </script>
